505	Toby's sour cherry shrub	Rinse 2 quarter of sour cherries and trim away any rot. Put the unpitted cherries in a large nonreactive pot and mash for several minutes with your hands or a wooden spoon to break the cherries down a bit. Pour in enough apple cider vinegar (preferably Bragg's) or other vinegar to cover the cherries. Cover and let stand at room temperature for 1 week, stirring daily. Don't be alarmed by the smell of the sludge on top. After 1 week, stir in .5 cup of raw sugar and boil gently for 1 hour, stirring occasionally. (The smell will be a bit offensive, so open the doors and windows.) Cool slightly, then strain through a cheesecloth-lined fine-mesh sieve. Make a test shrub: Cool 3 to 4 tablespoons of the cherry mixture. (Cover the pot to keep its contents warm.) Fill a 20-ounce glass with ice. Add water or club soda to almost the rim, then stir in the chilled cherry mixture. Taste and adjust as needed. If it's too tart, add another .5 cup or so of sugar, little by little, while it's still hot, stirring after each addition, until the sugar is dissolved. Once the taste is to your liking, cool complete. Store in the refrigerator, where it will keep indefinitely.	11	\N	2018-09-30 18:04:17.25887	2018-09-30 18:04:17.25887
